function CityWeatherCard(props) {
  const { cities } = props.Data
  return (
  <div>
    CityWeatherCard
    {cities.map(item => {
      return (
        <>
          {item.min}
          {item.max}
          {item.city}
        </>
      );
    })}
  </div>
  );
}

export default CityWeatherCard;
